// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider } from './AuthContext';
import PrivateRoute from './PrivateRoute'; // Import your PrivateRoute component

// Import your components
import WazuhActive from './components/wazuh_active';
import Home from './pages/Home';
import Agents from './pages/Agents';
import BackToTop from './components/scrollbutton';
import Login from './pages/Login';
import Register from './pages/Register';

function App() {
  return (
    <AuthProvider>
      <div className="App">
        <Router>
          {/* PrivateRoute should be a sibling of Routes, not a child */}
          <PrivateRoute path="/home" element={<Home />} />
          <PrivateRoute path="/wazuh-active" element={<WazuhActive />} />
          <PrivateRoute path="/agents" element={<Agents />} />

          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            {/* Redirect to login page by default */}
            <Route path="/" element={<Navigate to="/login" />} />
          </Routes>

          <BackToTop />
        </Router>
      </div>
    </AuthProvider>
  );
}

export default App;
